import React, { Component } from 'react';
import './App.css';
import Home from './containers/Home'
import Confirmation from './containers/Confirmation'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router";

class App extends Component {
  render() {
    return (
    	<Router>
    		<Switch>
    		<Route path="/">
	    		<Home/>
	    	</Route>
	    	<Route path="/confirmation">
	    		<Confirmation/>
	    	</Route>
	    	</Switch>
    	</Router>
    )
  }
}

export default App;
